import { SET_ALERT, REMOVE_ALERT } from '../action/types';

const intialState = [];

export default (state = intialState, action) => {
  switch (action.type) {
    case SET_ALERT:
      return [];
    case REMOVE_ALERT:
      return [];

    default:
      break;
  }
};
